import React from 'react';
import image from './images/todo.png'




const App = () =>{
    return(
       <>
       <div className='main_div'>
           <div className='child_div'>
               <figure>
                   <img src={image} alt='todo_logo' height='80' width='80'/>
                <figcaption>Add Your List Here</figcaption>
               </figure>
           </div>
       </div>
       </>
    )
}

export default App;
